import React from 'react'
//import Link from 'next/link'
//import Head from 'next/head'
//import FaviIcon from '../../atoms/atFavIcon'
import Layout from '../../moleculas/layout'
import MoHead from '../../moleculas/moHead'
import * as Util from '../../../controller/util.js';
import BtLink from '../../atoms/atBtLink'

const game = function (props) {

  console.log('╔══════════════════════╗');
  console.log('║  GANE - Cristal Bot  ║');
  console.log('╚══════════════════════╝');

  var regiao = Util.validaProps(props.regiao , "RJ");
  var modo = Util.validaProps(props.modo, "html");

  return (
    <div>
      <MoHead modo={modo} title="Cristal Bot" canonical="/game/cristalbot"/>
      <Layout regiao={regiao} modo={modo} titulo="Games Cristal Bot" categoria="Games">
          <h1>Game Cristal Bot</h1>
          <p>Alguns games de teste :)</p>
            <BtLink href={"/game/cristalbot?regiao="+regiao} value="GAME - Cristal Bot" estilo="luz"/>
            <p>Jogo Cristal Bot desenvolvido na Unity com C# modelagem 3D no Blender. <br/>
            Desenvolvi tanto o código quanto a arte do jogo.</p>
            <Img src="/static/assetsv5/img/cristalbot001.png" width="100px" height="100px" alt="Cristal Bot" title="Cristal Bot" class="Cristal Bot" modo={modo} />
            <Img src="/static/assetsv5/img/cristalbot002.png" width="100px" height="100px" alt="Cristal Bot" title="Cristal Bot" class="Cristal Bot" modo={modo} />
            <Img src="/static/assetsv5/img/cristalbot003.png" width="100px" height="100px" alt="Cristal Bot" title="Cristal Bot" class="Cristal Bot" modo={modo} />
            <Img src="/static/assetsv5/img/cristalbot004.png" width="100px" height="100px" alt="Cristal Bot" title="Cristal Bot" class="Cristal Bot" modo={modo} />
            <Img src="/static/assetsv5/img/cristalbot005.png" width="100px" height="100px" alt="Cristal Bot" title="Cristal Bot" class="Cristal Bot" modo={modo} />
            <Img src="/static/assetsv5/img/cristalbot006.png" width="100px" height="100px" alt="Cristal Bot" title="Cristal Bot" class="Cristal Bot" modo={modo} />
            <Img src="/static/assetsv5/img/cristalbot007.png" width="100px" height="100px" alt="Cristal Bot" title="Cristal Bot" class="Cristal Bot" modo={modo} />
            <Img src="/static/assetsv5/img/cristalbot008.png" width="100px" height="100px" alt="Cristal Bot" title="Cristal Bot" class="Cristal Bot" modo={modo} />
      </Layout>
      <style jsx>{`
        .h1{
          color : #000000;
        }
        .p{
          color : #000000;
        }
      `}</style>

    </div>
  )
}

export default game
